package com.datasouce.leetcode.threehundred;

import java.util.HashMap;
import java.util.Map;

/**
 * @author yeyulin 2020-09-04
 *         387 字符串中的第一个唯一字符
 */
public class ThreeHundredAndEightySeven {

    public int firstUniqChar(String s) {
        long stat = System.currentTimeMillis();
        Map<Character, Integer> map = new HashMap<>();
        char[] chars = s.toCharArray();
        int length = chars.length;
        for (int i = 0; i < length; i++) {
            char c = chars[i];
            map.put(c, map.getOrDefault(c, 0) + 1);
        }

        for (int i = 0; i < s.length(); ++i) {
            if (map.get(s.charAt(i)) == 1) {
                return i;
            }
        }
        long end = System.currentTimeMillis();
        System.out.println(stat - end);
        return -1;

    }

    public int firstUniqChar2(String s) {
        long stat = System.currentTimeMillis();
        Map<Character, Integer> map = new HashMap<>();
        for (char cs : s.toCharArray()) {
            map.put(cs, map.getOrDefault(cs, 0) + 1);
        }
        for (int i = 0; i < s.length(); ++i) {
            if (map.get(s.charAt(i)) == 1) {
                return i;
            }
        }

        long end = System.currentTimeMillis();
        System.out.println(stat - end);
        return -1;
    }

    public static void main(String[] args) {
        ThreeHundredAndEightySeven threeHundredAndEightySeven = new ThreeHundredAndEightySeven();
//        s = "leetcode"
//        返回 0
//
//        s = "loveleetcode"
//        返回 2


        threeHundredAndEightySeven.firstUniqChar2(
                "");

        threeHundredAndEightySeven.firstUniqChar(
                "");




    }

}
